import { useCallback, MouseEventHandler } from "react";
import 'src/Component/button.scss';
import { HogeList } from 'src/Component/HogeList';

const CustomButton: React.FC = () => {
    const handleClick: MouseEventHandler<HTMLButtonElement>  = useCallback((event) => {
        const index = parseInt(event.currentTarget.dataset.index || '0',10);
        const HogeItem = HogeList[index];
        console.log(HogeItem.ButtonTitle+'がクリックされました');
    },[]);
    return (
        <ul>
            <button
            // key={ index }
            onClick={ handleClick }
            >
                <li>
                    ABC
                </li>
            </button>
        </ul>
    );
};

export default CustomButton;
